    private IList<string> ImageDateUrls = new List<string>();
    private async Task OnInputFileChange(InputFileChangeEventArgs e)
    {
        ImageDateUrls.Clear();
        nuevo.Foto = null;
        var maxAllowedFile = 1;
        var format = "image/jpg";
        foreach (var imageFile in e.GetMultipleFiles(maxAllowedFile))
        {

            var resizedFile = await imageFile.RequestImageFileAsync(format, 200, 200);

            var buffer = new byte[resizedFile.Size];
            await resizedFile.OpenReadStream().ReadAsync(buffer);
            nuevo.Foto = buffer;
            var imageDataUrl = $"data:{format};base64,{Convert.ToBase64String(buffer)}";
            ImageDateUrls.Add(imageDataUrl);


        }

    }

    private void TipoPublicacion(string n)
    {
        switch (n)
        {
            case "Perdido":

                nuevo.Estado = n;
                nuevo.Tipo = 1;
                nombre = true;
                break;
            case "En Adopción":
                nuevo.Estado = n;
                nuevo.Tipo = 2;
                nombre = true;
                break;

            case "Encontrado":
                nuevo.Estado = n;
                nuevo.Tipo = 3;
                nombre = false;
                break;
                //default:
                //    colorHeader = "#ff9494";
                //    break;
        }
        tipo = nuevo.Estado;


    }









